import { Link } from "react-router-dom";

function Navbar() {
  const token = localStorage.getItem("token")
  return (
    
    <div>
      <nav>
        <ul>
          <Link to="/register">Register</Link>
          <Link to="/login">Login</Link>
          <Link to="/">Homepage</Link>
        </ul>
      </nav>
    </div>
  );
}

export default Navbar;
